import React, { useEffect, useState } from "react";
import { Layout, Menu, Icon } from "antd";

const { Header, Content, Footer, Sider } = Layout;

const edocMain = () => {
  const [selectedPage, setSelectedPage] = useState("1");
  return (
    <Layout>
      <Sider
        breakpoint="lg"
        collapsedWidth="0"
        onBreakpoint={broken => {
          console.log(broken);
        }}
        onCollapse={(collapsed, type) => {
          console.log(collapsed, type);
        }}
      >
        <div className="logo" />
        <Menu
          theme="dark"
          mode="inline"
          defaultSelectedKeys={selectedPage}
          onClick={(item, key) => console.log("?", item, key)}
        >
          <Menu.Item key="1">
            <Icon type="user" />
            <span className="nav-text">전자결재</span>
          </Menu.Item>
          <Menu.Item key="2">
            <Icon type="video-camera" />
            <span className="nav-text">업무요청</span>
          </Menu.Item>
          <Menu.Item key="3">
            <Icon type="upload" />
            <span className="nav-text">전자문서</span>
          </Menu.Item>
          <Menu.Item key="4">
            <Icon type="user" />
            <span className="nav-text">공지사항</span>
          </Menu.Item>
        </Menu>
      </Sider>
      <Layout>
        <Header style={{ background: "#fff", padding: 0 }} />
        <Content style={{ margin: "24px 16px 0" }}>
          <div style={{ padding: 24, background: "#fff", minHeight: 360 }}>
            content
          </div>
        </Content>
        <Footer style={{ textAlign: "center" }}>급여박사 그룹웨어</Footer>
      </Layout>
    </Layout>
  );
};

export default edocMain;
